import axios from "axios";

export const ApiLogin = (param)=>{
    return axios.post('http://indoor.lcprojects.net/api/login.php', {data:{nome:'luan', senha:'luan123'}}, {headers:{'Content-Type':'application/x-www-form-urlencoded'}})
}
